import React, { useEffect } from 'react';
import '../../css/about.css';

const About = () => {

  useEffect(() => {
    document.title = "SHAREHOME - How to play";
  });

  return (
    <div className="content">
      <h1 className="title">SHAREHOME</h1>
      <h1>How to play?</h1>
      <p>SHAREHOME is a very flexible party game with multiple ways of playing it</p>
    </div>
  );
}

export default About;
